import Cards from './Cards';

const CardsList = ({ people }) => {

	const peo = (cha) => {
		return(
			people && 
				people.map((person, i) => {
					return(people[i])	
			})
		);
	}

	return(
		<div>
			{ people && console.log(peo(people)) }			
		</div>
	)
}

export default CardsList;

<Cards person = { peo(people) }/>
